import React from "react";
import ConfigFooter from '../capas/footer/footer';
import Form from "../capas/formulario/formulario";
import ConfigHeadModificado from '../capas/headModificado/headModificado';
import ListaUsuarios from "../capas/usuarioIndividual/ListaUsuarios";




const Contacto = () =>  {

    return(

    <div>
        <ConfigHeadModificado/>        

        <Form/>
        <ListaUsuarios/>
        <ConfigFooter/>
    </div>
    )
};



export default Contacto;
